import React, { Component } from 'react';
import DropDown from '../../components/DropDown';

class Home extends Component {

  state = {
    items : ["A", "B", "C"],
    itemToString : "A",
    children: "Soy el hijo",
    whatever : false
  }

  changeWhatever = (event) => {
    let whatever = event.target.value;
    this.setState({ whatever : whatever });
  }

  render() {

    console.log("Home page");

    let message =

      <React.Fragment>

        <section>
          <div>
            <h1>
              <strong> ARRANGER TESTING ZONE II</strong>
              <DropDown 
                    items = {this.state.items}
                    onChange = {(event) => this.changeWhatever(event)}
                    itemToString = {this.state.itemToString}
                    children = {this.state.children}
                    align = 'right'          
              > Hi </DropDown>
            </h1>
          </div>
        </section>

      </React.Fragment>

    return (
      <div>
        {message}
      </div>
    )
  }
}

export default Home;
